struct AXIS_wLAST{
	int data;
	bool last;
};

void myip_MLP_quant_HLS(hls::stream<AXIS_wLAST>& S_AXIS, hls::stream<AXIS_wLAST>& M_AXIS);

#define TEST_CASE_COUNT 50

int test_input_memory[INPUT_SIZE * TEST_CASE_COUNT];
float test_label[TEST_CASE_COUNT];
int test_output_memory[TEST_CASE_COUNT * OUTPUT_SIZE];
int test_expect_memory[TEST_CASE_COUNT * OUTPUT_SIZE];

int relu(int x);
int dot_product(int a[], int b[], int n);
void softmax(int a[]);

int find_label(int a[]) {
	int idx = 0;
	int max = a[0];
	for (int i = 1; i < OUTPUT_SIZE; i++) {
		if (a[i] > max) {
			max = a[i];
			idx = i;
		}
	}
	return idx;
}

void print_array(int a[]) {
	for (int i = 0; i < OUTPUT_SIZE; i++) {
		printf("%d ", a[i]);
	}
	printf("\n");
}

int main() {
	int word_cnt, test_case_cnt = 0, i, j, k, l;
	int success;
	AXIS_wLAST read_output, write_input;
	hls::stream<AXIS_wLAST> S_AXIS;
	hls::stream<AXIS_wLAST> M_AXIS;

	/************** Run a software version of the hardware function to validate results ************/
	// instead of hard-coding the results in test_result_expected_memory


	/********************** Reading input layer **************************/
	freopen("/home/wsl2/csv/input300.csv", "r", stdin);
	for (i = 0; i < TEST_CASE_COUNT; i++) {
		for (j = 0; j < INPUT_SIZE; j++) {
			float t;
			scanf("%f", &t);
			test_input_memory[i * INPUT_SIZE + j] = int(t * 255);
		}
		scanf("%f", &test_label[i]);
	}
	fclose(stdin);
	int count = 0;

	/********************** Test software (C++) implementation **************************/
	for (i = 0; i < TEST_CASE_COUNT; i++) {
		for (j = 0; j < HIDDEN1_SIZE; j++) {
			hidden1[j] = dot_product(hidden1_matrix[j], &test_input_memory[i * INPUT_SIZE], INPUT_SIZE) + bias1[j];
			hidden1[j] = relu(hidden1[j]);
		}
		for (j = 0; j < HIDDEN2_SIZE; j++) {
			hidden2[j] = dot_product(hidden2_matrix[j], hidden1, HIDDEN1_SIZE) + bias2[j];
			hidden2[j] = relu(hidden2[j]);
		}
		for (j = 0; j < OUTPUT_SIZE; j++) {
			test_expect_memory[i * OUTPUT_SIZE + j] = dot_product(output_matrix[j], hidden2, HIDDEN2_SIZE) + bias3[j];
		}
		softmax(&test_expect_memory[i * OUTPUT_SIZE]);
		if (find_label(&test_expect_memory[i * OUTPUT_SIZE]) != int(test_label[i])) {
			printf("Incorrect label for test case: %d\n"
					"Expect: %d\n"
					"Actual: %d\r\n", i,
					int(test_label[i]),
					find_label(&test_expect_memory[i * OUTPUT_SIZE]));
			print_array(&test_expect_memory[i * OUTPUT_SIZE]);
			count++;
		}
	}
	printf("accuracy: %f\n", 100.0 - count / 5.0);

	/********************** Test HLS implementation **************************/
	for (i = 0; i < TEST_CASE_COUNT; i++){
		/******************** Input to Coprocessor : Transmit the Data Stream ***********************/
		printf(" Transmitting Data for test case %d ... \r\n", i);
		for (j = 0 ; j < INPUT_SIZE ; j++){
			write_input.data = test_input_memory[i * INPUT_SIZE + j];
			write_input.last = 0;
			if (word_cnt == INPUT_SIZE - 1) {
				write_input.last = 1;
			}
			S_AXIS.write(write_input);
		}

		/* Transmission Complete */

		/********************* Call the hardware function (invoke the co-processor / ip) ***************/

		myip_MLP_quant_HLS(S_AXIS, M_AXIS);

		/******************** Output from Coprocessor : Receive the Data Stream ***********************/

		printf(" Receiving data for test case %d ... \r\n", test_case_cnt);

		for (j = 0; j < OUTPUT_SIZE ; j++){

			read_output = M_AXIS.read(); // extract one word from the stream
			test_output_memory[i * OUTPUT_SIZE + j] = read_output.data;
		}
		print_array(&test_output_memory[i * OUTPUT_SIZE]);
		putchar('\n');
		for (j = OUTPUT_SIZE; j < 16; j++) {
			read_output = M_AXIS.read();
			printf("%d ", read_output.data);
		}
		/* Reception Complete */
	}

	/************************** Checking correctness of results *****************************/
	success = 1;

	/* Compare the data send with the data received */
	printf(" Comparing data ...\r\n");
	for(i = 0; i < TEST_CASE_COUNT * OUTPUT_SIZE; i++){
		success = success & (test_output_memory[i] == test_expect_memory[i]);
		if (!success) {
			printf("fail: %d %d %d\n", i / TEST_CASE_COUNT, test_output_memory[i], test_expect_memory[i]);
		}
	}

	if (success != 1){
		printf("Test Failed\r\n");
		return 1;
	}

	printf("Test Success\r\n");
	return 0;
}
